import './App.css';
import { Outlet } from 'react-router-dom';
import { Toaster } from 'react-hot-toast';

function App() {
  return (
    <div className="">
      <Toaster
        toastOptions={{
          success: {
            style: {
              background: 'green',
            },
          },
          error: {
            style: {
              background: 'red',
              color: 'white',
              fontSize: 15,
              width: 400
            },
          },
        }}
      />
      <Outlet></Outlet>
    </div>
  );
}

export default App;
